import React from 'react';
import Feature from '../../components/feature/Feature';
import './whatGPT3.css';

const WhatGPT3 = () => (
  <div className="gpt3__whatgpt3 section__margin" id="wgpt3">
    <div className="gpt3__whatgpt3-feature">
      <Feature title="What is Codely" text="We so opinion friends me message as delight. Whole front do of plate heard oh ought. His defective nor convinced residence own. Connection has put impossible own apartments boisterous. At jointure ladyship an insisted so humanity he. Friendly bachelor entrance to on by." />
    </div>
    <div className="gpt3__whatgpt3-heading">
      <h1 className="gradient__text">The possibilities are beyond your imagination</h1>
      <p>Explore the Library</p>
    </div>
    <div className="gpt3__whatgpt3-container">
      <Feature title="AI Generated Levels" text="Random tests generated by our AI that will help you practice what you learn." />
      <Feature title="Over 100 Levels" text="Over 100 Levels that you can choose from , with 5 different programming languages and more to come" />
      <Feature title="Every programming language" text="From C , to Python or Javascript , every language is sure to be available in the future in Codely" />
    </div>
  </div>
);

export default WhatGPT3;
